window.bookSummaryJSON = "<p>Old gods die hard.</p> <p>Professional necromancer Lazarus Kerrigan knows all too well that the Big Easy is anything but. Crime is up, business is down, and someone--or something--crushed an innocent girl to death on his doorstep.</p> <p>After the search for the murderer brings the police to his front door, Laz must prove his innocence by hauling in the real killer with help from the dead.</p> <p>When the sun sets in New Orleans, more than monsters go bump in the night... And what Laz awakens in his quest for answers might just get him--and everyone else in town--killed.</p> <p>Fans of The Dresden Files and Iron Druid will love this wisecracking wizard! Get your copy today!</p>"; 
